name: nrh

model_type: segmented_regression

segmentation_col: hedonic_sector_id

fit_filters:
- non_residential_sqft > 0
- year_built > 1700
- stories > 0
- sqft_price_nonres > 0
- 21 <= building_type_id <= 71

predict_filters:
- non_residential_sqft > 0
- 21 <= building_type_id <= 71

min_segment_size: 10

default_config:
    model_expression: np.log1p(sqft_price_nonres) ~ I(year_built < 1940) + year_built
        + stories + np.log1p(non_residential_sqft) + np.log1p(popden) + crime_ucr_rate
    ytransform: np.exp

